  [],\n\t\"revision_timestamp\": \"2015-11-25T17:39:56.215129\",\n\t\"name\": \"sbuv2-noaa-16-ozone-profile-ozone-total-column-1-orbit-l2-200x200-km-v008\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The version 8 SBUV/2 NOAA-16 ozone data
  were first released at the 2004 Quadrennial Ozone Symposium on DVD. The DVD contained
  all of the SBUV/2 data from NOAA-9, NOAA-11 and NOAA-16 satellites as well as SBUV
  data from the Nimbus-7 satellite. The DVD is no longer available, however all the
  data are available on-line from the NASA GES DISC. The NOAA-16 SBUV/2 v8 data are
  available from 2000-10-03 to 2003-12-31. The instrument spatial resolution is 180
  km x 180 km footprint at nadir. The ozone profiles are made at 21 pressure levels
  between 1000 and 0.1 hPa. Each data file contains a days worth of ozone measurements,
  and is written in an ASCII text format.nnThe SBUV/2 is a scanning double monochromator
  and a cloud cover radiometer (CCR) designed to measure ultraviolet (UV) spectral
  intensities. In its primary mode of operation, the monochromator measures solar
  radiation backscattered by the atmosphere in 12 discrete wavelength bands in the
  near-UV, ranging from 252.0 to 339.8 nanometers, each with a bandpass of 1.1 nm.
  The total-ozone algorithm uses the four longest wavelength bands (312.5, 317.5,
  331.2 and 339.8 nm), whereas the profiling algorithm uses the shorter wavelengths.
  The cloud cover radiometer operates at 379 nm (i.e., outside the ozone absorption
  band) with a 3.0 nm bandpass and was designed to measure the reflectivity of the
  surface in the IFOV. The SBUV/2 also makes periodic measurements of the solar flux
  by deploying a diffuser plate into the FOV to reflect sunlight into the measurement.From
  these data, the following atmospheric properties can be deduced:n* The global and
  vertical distribution of stratospheric ozone.n* The structure and dynamics of stratospheric
  ozone.n* Photochemical processes and the influence of \"trace\" constituents on
  the ozone layer.n* Long-term solar activity in the Ultraviolet spectrum.\",\n\t\"license_title\":
